if mibBuilder.loadTexts: a3ComRoutePolicyOriginProtocol.setDescription('This object is only used when a3ComRoutePolicyType is set to export(2). It makes up a mask of protocols, within the protocol suite, that matches the policy entry. If set to zero, the mask will be interpreted as a match, independent of how the route was learned. A value of 1 stands for matches on routes directly attached. A value of 2 stands for matches on routes that were statically defined in the routing table. All other values in the mask carry different meaning, depending on the current value of a3ComRoutePolicyProtocolType. The following tables summarizes such values: ------------------------------------- Any Protocol Family ------------------------------------- 00 | all (route learned by any way) 01 | directly attached route 02 | statically defined route ------------------------------------- ------------------------------------- IP | IPX | APPLETALK ------------------------------------- 04 | rip | rip | rtmp 08 | ospf | sap | kip 16 | bgp4 | unused | aurp 32 | unused | unused | unused ------------------------------------- Table 1: Route policy origin protocol mask The value of this object can be modified at any time. Examples: 1) When exporting from any protocol suite, any route learned in that suite will be advertised if a3ComRoutePolicyOriginProtocol is set to zero and the other preconditions apply. 2) When exporting from any protocol suite, only routes that were learned from static definition or that are directly attached would be advertised if a3ComRoutePolicyOriginProtocol is set to 3 (mask of 1 + 2) and the other preconditions apply. 3) When exporting from ip_rip(2), only routes that were learned from rip or bgp4 advertisements would be given out if a3ComRoutePolicyOriginProtocol is set to 20 (mask of 4 + 16) and the other preconditions apply. 4) If at example 3 we had a3ComRoutePolicyProtocolType set to at_rtmp(7) instead of ip_rip(2), the same value (i.e. 20) would indicate that advertisements under appleTalk rtmp would only include routes learned from rtmp(4) or aurp(16).')
